#include <stdio.h>

//Function declarations
void set_A9_IRQ_stack();
void config_GIC();
void config_KEYs();
void enable_A9_interrupts();
void pushbutton_ISR();
void disable_A9_interrupts();
void config_PS2();
void config_Audio();
void PS2_ISR();
void KEY_ISR();
