void beep_boop();
void wait_for_vsync();
void draw_victory_screen();

volatile int pixel_buffer_start; // global variable
volatile int* pixel_ctrl_ptr;

int released = 0;
volatile int chosen_level = 0;
volatile int game_on = 0;
volatile int in_left_corner = FALSE;
volatile int in_right_corner = FALSE;
int center_bar_x = (RESOLUTION_X / 2) - 1;

int beep[800];

BufferData* BB;
BufferData* FB;

int main(void)
{
	pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;
	
	disable_A9_interrupts();
	set_A9_IRQ_stack();
	config_GIC();
	config_KEYs();
	config_PS2();
    config_Audio();
	enable_A9_interrupts(); // enable interrupts in the A9 processor 
	
	pixel_ctrl_ptr = (int *)0xFF203020;
	/* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	draw_start_screen();
	
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	clear_screen();
	
	// Make variables to track buffer status
	BB = (BufferData*)malloc(sizeof(BufferData));
	FB = (BufferData*)malloc(sizeof(BufferData));
	
	while (1) {
		volatile int* SW_ptr = (int*) SW_BASE;
		
		if ((*(SW_ptr) > 1)) {
			int data = *(SW_ptr);
			int level = 0;
			
			while (!(data & 0x1)) {
				level++;
				data = data >> 1;
			}
			
			if (level == 0 || level > 7) continue;
			
			while (*(SW_ptr) != 0);
			
			chosen_level = level - 1;
			game_on = 1;
		}
		
		if (game_on) play_game();
	}
}

void setup_level(GamePlayData* GD) {
	clear_screen();
	
	// Draw the boundaries in grey
	for (int y = 0; y < RESOLUTION_Y; y++) {
		for (int x = 0; x < X_BOUND; x++) {
			plot_pixel(x, y, GREY);
			plot_pixel(RESOLUTION_X - x, y, GREY);
		}
	}
	
	for (int x = 0; x < RESOLUTION_X; x++) {
		for (int y = 0; y < X_BOUND; y++) {
			plot_pixel(x, y, GREY);
		}
	}
	
	// Draw the texts
	for (int y = 0; y < 10; y++) {
		for (int x = 0; x < 56; x++) {
			plot_pixel(x + 15, y, score[y][x]);
			plot_pixel(x + 135, y, level_text[y][x]);
			plot_pixel(x + 233, y, ball_text[y][x]);
		}
	}
	
	// Draw the numbers for the texts
	for (int y = 0; y < 10; y++) {
		for (int x = 0; x < 12; x++) {
			// Score numbers
			plot_pixel(x + 71, y, numbers[GD->score/100][y][x]);
			plot_pixel(x + 83, y, numbers[(GD->score/10)%10][y][x]);
			plot_pixel(x + 95, y, numbers[GD->score%10][y][x]);
			
			// Level number
			plot_pixel(x + 191, y, numbers[GD->level + 1][y][x]);
			
			// Balls number
			plot_pixel(x + 289, y, numbers[GD->balls_left][y][x]);
		}
	}
	
	GD->bricks_left = GD->LD[GD->level].num_bricks;
	if (GD->level == 6) GD->bricks_left-=2;
    GD->balls_left = GD->LD[GD->level].balls;
    
	GD->balls = (ball*)calloc(GD->balls_left, sizeof(ball));
	BB->balls = (ball*)calloc(GD->balls_left, sizeof(ball));
	FB->balls = (ball*)calloc(GD->balls_left, sizeof(ball));
	GD->explosive_alive = FALSE;

	int taken = 0;
    for (int i = 0; i < GD->balls_left; i++) { // instantiate balls
        GD->balls[i].alive = 1;
        GD->balls[i].centre_x = RESOLUTION_X/2;
        GD->balls[i].centre_y = RESOLUTION_Y-26;
        GD->balls[i].dy = -1;
		GD->balls[i].dx = ((taken == 0) ? ((rand()%2*2) - 1) : taken*-1); // random x direction
		if (i == 2) {
			GD->balls[i].explosive = 1;
			GD->explosive_alive = TRUE;
		}
		else {
			GD->balls[i].explosive = 0; // if 3 balls, that means its really 2 with one being explosive
		}
		taken = GD->balls[i].dx;
		
		BB->balls[i].alive = 1;
        BB->balls[i].centre_x = RESOLUTION_X/2;
        BB->balls[i].centre_y = RESOLUTION_Y-26;
        BB->balls[i].dy = -1;
        BB->balls[i].dx = GD->balls[i].dx; // random x direction
		BB->balls[i].explosive = GD->balls[i].explosive; 
		
		FB->balls[i].alive = 1;
        FB->balls[i].centre_x = RESOLUTION_X/2;
        FB->balls[i].centre_y = RESOLUTION_Y-26;
        FB->balls[i].dy = -1;
        FB->balls[i].dx = GD->balls[i].dx; // random x direction
		FB->balls[i].explosive = GD->balls[i].explosive;
    }
	
    GD->level_over = 0;
	
	// Update the buffer values
	BB->num_balls = GD->balls_left;
	FB->num_balls = GD->balls_left;
	
	center_bar_x = (RESOLUTION_X / 2) - 1;
	
	BB->bar_center = center_bar_x;
	FB->bar_center = center_bar_x;
}

void draw_ball(ball b, int color) {
    // Draws an approximation of a circle that is the ball
    int width = 1;
    for (int y = b.centre_y-RADIUS; y <= b.centre_y+RADIUS; y++) {
        for (int x = b.centre_x-width; x <= b.centre_x+width; x++) {
            if (x < X_BOUND || x > RESOLUTION_X - X_BOUND - 1) continue;
			if (y < Y_BOUND) continue;
			plot_pixel(x,y,color);
        }
        if (y - b.centre_y < 1) width++;
        if (y - b.centre_y > 1) width--;
    }
}

void play_level(GamePlayData* GD) {
    // Controls the gameplay for the level
    setup_level(GD);
	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	
	setup_level(GD);
	
    while (!GD->level_over) {
		for (int i = 0; i < BB->num_balls; i++) {
			draw_ball(BB->balls[i], BLACK);
			draw_bar(BB->bar_center, BLACK);
		}
		
        draw_level(GD); // draws the bricks, balls and platform
        update_level(GD);
		
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }

    if (GD->bricks_left == 0) {
		if (GD->level == NUM_LEVELS-1) {
			GD->game_over = TRUE;
		}
		GD->level++;
	}
    else GD->game_over = 1; // all balls gone
    return;
}

void update_level(GamePlayData* GD) {
	int speed = GD->LD[GD->level].speed;
	
    // Balls continue on their path unless they collide with the platform, bricks, wall, or go out of bounds
    for (int i = 0; i < GD->LD[GD->level].balls; i++) {
        ball* curr = &GD->balls[i];
        if (!curr->alive) continue;
        
        // A. Check boundaries 

        // check if it is hitting the platform or past the platform
        if (curr->centre_y + RADIUS >= RESOLUTION_Y-1) {
            curr->alive = 0;
            GD->balls_left--;
			if (curr->explosive) GD->explosive_alive = FALSE;
        }
        if ((curr->centre_y + RADIUS >= RESOLUTION_Y-Y_BOUND-BAR_HEIGHT) && (curr->centre_y + RADIUS < RESOLUTION_Y-Y_BOUND-BAR_HEIGHT+speed)) {
            if (abs(curr->centre_x-center_bar_x) < BAR_WIDTH/2+RADIUS+speed) curr->dy = -1; // bouncing off the platform
            // else, it will just continue out of the frame 
        }
        // check if it hitting the top
        if (curr->centre_y - RADIUS <= Y_BOUND) {
            curr->dy = 1;
        }
        // check if it hitting the right wall
        if (curr->centre_x + RADIUS >= RESOLUTION_X-X_BOUND-1) {
            curr->dx = -1;
        }
        // check if it is hitting the left wall
        if (curr->centre_x - RADIUS <= X_BOUND) {
            curr->dx = 1;
        }

        // B. Check if it is hitting a brick (from on top, from below, from left or from right)
		int first_brick_hit_id = -1;
		int only_dx = 0;
		int only_dy = 0;
		int hit_id = 0; // 1 for left, 2 for right, 3 for top 4 for bottom

 		for (int i = 0; i < GD->LD[GD->level].num_bricks; i++) {
            block* curr_brick = &GD->LD[GD->level].bricks[i];
            if (curr_brick->hp == 0) continue; // brick is already gone
            
			// row column heuristic
            if (curr->centre_x + RADIUS >= curr_brick->left && curr->centre_x - RADIUS <= curr_brick->left+BRICK_WIDTH) { // x is in range for a collision
                if (curr->centre_y + RADIUS >= curr_brick->top && curr->centre_y - RADIUS <= curr_brick->top+BRICK_HEIGHT) { // y is in range for a collision
                    // check to see if there is another brick it is hitting above, below, or to each side
					if (first_brick_hit_id == -1) first_brick_hit_id = i;
					else { // hitting multiple bricks
						// check to see if row or column
						if (abs(GD->LD[GD->level].bricks[first_brick_hit_id].left - curr_brick->left) == BRICK_WIDTH && GD->LD[GD->level].bricks[first_brick_hit_id].top == curr_brick->top) {
							// in a row
							only_dy = TRUE;
						}
						else if (abs(GD->LD[GD->level].bricks[first_brick_hit_id].top - curr_brick->top) == BRICK_WIDTH && GD->LD[GD->level].bricks[first_brick_hit_id].left == curr_brick->left) {
							only_dx = TRUE;
						}
					}
					
					// find which side hit and manage the deflection
					int l_diff = curr->centre_x + RADIUS - curr_brick->left;
					int r_diff = curr_brick->left+BRICK_WIDTH-curr->centre_x;
					int t_diff = curr->centre_y + RADIUS - curr_brick->top;
                    if (l_diff > 0 && l_diff <= speed+1 && curr->dx != -1 && !only_dy) { // colliding on the left face
                        hit_id = 1;
                    }
                    else if (r_diff > 0 && r_diff <= speed+1 && curr->dx != 1 && !only_dy) { // colliding on the right face
                        hit_id = 2;
                    }
                    else if (t_diff > 0 && t_diff <= speed+1 && curr->dy != -1 && !only_dx) { // colliding on the top face
                        hit_id = 3;
                    }
                    else if (!only_dx) { // colliding on the bottom face
                        hit_id = 4;
                    }

                    if (!curr->explosive) { curr_brick->hp--; GD->score++; beep_boop();}// so that explosive only deals single damage
                    
                    
					if (curr_brick->hp == 1 && curr->explosive) {
						curr->explosive = 0;
						curr->dx = -1*GD->balls[0].dx; // other direction
						GD->explosive_alive = FALSE;
					}
                    if (curr_brick->hp == 0) GD->bricks_left--;
                }
            }
        }
		
		if (hit_id == 1) curr->dx = -1;
		else if (hit_id == 2) curr->dx = 1;
		else if (hit_id == 3) curr->dy = -1;
		else if (hit_id == 4) curr->dy = 1;

        curr->centre_x += curr->dx*speed; // updating positions
        curr->centre_y += curr->dy*speed;
		
    }
	
	int num_balls_temp = FB->num_balls;
	FB->num_balls = BB->num_balls;
	BB->num_balls = num_balls_temp;
	
	ball* balls_temp = FB->balls;
	FB->balls = BB->balls;
	BB->balls = balls_temp;
	
	int center_temp = FB->bar_center;
	FB->bar_center = BB->bar_center;
	BB->bar_center = center_temp;

    if (GD->balls_left == 0 || GD->bricks_left == 0) GD->level_over = 1;
}

void beep_boop() {
    volatile int* audio_ptr = (int*)AUDIO_BASE;
    //*(audio_ptr) += 0x8; // clear audio
    unsigned int fifospace;
    int beep_size = 800;
    int i = 0;

    while (i < beep_size) {
        fifospace = *(audio_ptr+1);
        if ((fifospace & 0x00FF0000) > 0 && (fifospace & 0xFF000000) > 0) { // space to write
            int curr_val = beep[i];
            *(audio_ptr+2) = curr_val;
            *(audio_ptr+3) = curr_val;
        }
        i++;
    }
}

void draw_bricks(int num_bricks, block* bricks, int draw_non_black) {
    for (int i = 0; i < num_bricks; i++) {
        if (draw_non_black && bricks[i].hp != 0) {
			draw_brick(&bricks[i]);
		}
		else if (!draw_non_black && bricks[i].hp == 0) {
			draw_brick(&bricks[i]);
		}
    }
}

void draw_balls(int num_balls, ball* balls) {
	for (int i = 0; i < num_balls; i++) {
		int color = (balls[i].explosive ? RED : WHITE);
        if (balls[i].alive) draw_ball(balls[i], color);
    }
}

void draw_level(GamePlayData* GD) {
    draw_bricks(GD->LD[GD->level].num_bricks, GD->LD[GD->level].bricks, FALSE);
    draw_balls(GD->LD[GD->level].balls, GD->balls);
	draw_bricks(GD->LD[GD->level].num_bricks, GD->LD[GD->level].bricks, TRUE);
    draw_bar(center_bar_x, WHITE);

	// Draw the texts
	for (int y = 0; y < 10; y++) {
		for (int x = 0; x < 56; x++) {
			plot_pixel(x + 15, y, score[y][x]);
			plot_pixel(x + 135, y, level_text[y][x]);
			plot_pixel(x + 233, y, ball_text[y][x]);
		}
	}
	
	// Draw the numbers for the texts
	for (int y = 0; y < 10; y++) {
		for (int x = 0; x < 12; x++) {
			// Score numbers
			plot_pixel(x + 71, y, numbers[GD->score/100][y][x]);
			plot_pixel(x + 83, y, numbers[(GD->score/10)%10][y][x]);
			plot_pixel(x + 95, y, numbers[GD->score%10][y][x]);
			
			// Level number
			plot_pixel(x + 191, y, numbers[GD->level + 1][y][x]);
			
			// Balls number
			int b = (GD->explosive_alive ? GD->balls_left-1 : GD->balls_left);
			plot_pixel(x + 289, y, numbers[b][y][x]);
		}
	}
	
	for (int i = 0; i < BB->num_balls; i++) { // update ball locations
		BB->balls[i].alive = GD->balls[i].alive;
        BB->balls[i].centre_x = GD->balls[i].centre_x;
        BB->balls[i].centre_y = GD->balls[i].centre_y;
        BB->balls[i].dy = GD->balls[i].dy;
        BB->balls[i].dx = GD->balls[i].dx;
    }
	
	BB->num_balls = GD->LD[GD->level].balls;
	BB->bar_center = center_bar_x;
}

void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	int status;
	
	*(pixel_ctrl_ptr) = 1;
	status = *(pixel_ctrl_ptr + 3);
	
	while((status & 0x1) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
}

