void config_KEYs() {
	volatile int* KEY_ptr = (int*) KEY_BASE; // pushbutton KEY address
	*(KEY_ptr + 2) = 0xF;					 // enable interrupts for KEYs
}

void config_PS2() {
	volatile int* PS2_ptr = (int*) 0xFF200100;
	*(PS2_ptr + 1) = 0x1;
}

void config_Audio() {
	volatile int* Audio_ptr = (int*) AUDIO_BASE;
	*(Audio_ptr) = 0x2;
    for (int i = 0; i < 800; i++) { // square wave at f = 400 Hz, 8 KHz sampling rate
        if ((i/10)%2 == 1) {
            beep[i] = -1*100000000;
        }
        else {
            beep[i] = 100000000;
        }
    }
}

void disable_A9_interrupts(void) {
	int status = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void enable_A9_interrupts(void) {
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void config_interrupt(int N,int CPU_target) {
	int reg_offset, index, value, address;
	
	/*Configure the Interrupt Set-Enable Registers (ICDISERn).
	*reg_offset = (integer_div(N / 32)*4*value = 1 << (N mod 32)*/
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index      = N & 0x1F;
	value      = 0x1 << index;
	address    = 0xFFFED100 + reg_offset;
	
	/*Now that we know the register address and value, set the appropriate bit*/
	*(int*)address |= value;
	
	/*Configure the Interrupt Processor Targets Register (ICDIPTRn)
	*reg_offset = integer_div(N / 4)*4*index = N mod 4*/
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	
	/*Now that we know the register address and value, write to (only) the*appropriate byte*/
	*(char*)address = (char)CPU_target;
}

void config_GIC() {
	config_interrupt(73, 1);	//KEYS ID
	config_interrupt(79, 1);	//PS2 ID
	
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
	// priorities
	*((int*) 0xFFFEC104) = 0xFFFF;
	
	// Set CPU Interface Control Register (ICCICR). Enable signaling of
	// interrupts
	*((int*) 0xFFFEC100) = 1;
	
	// Configure the Distributor Control Register (ICDDCR) to send pending
	// interrupts to CPUs
	*((int*) 0xFFFED000) = 1;
}

void set_A9_IRQ_stack() {
	int stack, mode;
	stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
	
	/*change processor to IRQ mode with interrupts disabled*/
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	
	/*set banked stack pointer*/
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	
	/*go back to SVC mode before executing subroutine return!*/
	mode = 0b11010011;asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

void __attribute__((interrupt)) __cs3_isr_irq(void) {
	// Read the ICCIAR from the CPU Interface in the GIC
	int interrupt_ID = *((int*) 0xFFFEC10C);
	
	if (interrupt_ID == 73)	// check if interrupt is from the KEYs
		pushbutton_ISR();
	else if (interrupt_ID == 79)
		PS2_ISR();
    else 
		while(1);			// if unexpected, then stay here
	
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int*) 0xFFFEC110) = interrupt_ID;
}



void pushbutton_ISR(void) {
	volatile int* KEY_ptr = (int*) 0xFF200050;
	
	// Clear the interrupt
	*(KEY_ptr + 3) = 0xF;
	
	game_on = 1;
}

void PS2_ISR(void) {
	/*PS2 base address*/
	volatile int* PS2_ptr = (int *) 0xFF200100;
	int PS2_data = *(PS2_ptr);
	int RAVAIL = PS2_data & 0xFFFF0000;
	int RVALID = PS2_data & 0x8000;
	
	unsigned char keyPress = PS2_data & 0xFF;
	
	int DIFF = 6;

	if (keyPress == 't' && released == 1) {
		if (center_bar_x + 15 < RESOLUTION_X - X_BOUND - BAR_WIDTH/2) {
			draw_bar(center_bar_x, BLACK);	
			if (in_left_corner) { center_bar_x += DIFF-2; in_left_corner = FALSE; }
			else center_bar_x += 15;
		}
		else if (center_bar_x + DIFF < RESOLUTION_X - X_BOUND - BAR_WIDTH/2) {
			draw_bar(center_bar_x, BLACK);
			center_bar_x += DIFF+2;
			in_right_corner = TRUE;
		}
	}
	
	if (keyPress == 'k' && released == 1) {
		if (center_bar_x - 15 >= X_BOUND + BAR_WIDTH/2 - 1) {
			draw_bar(center_bar_x, BLACK);	
			if (in_right_corner) { center_bar_x -= (DIFF+2); in_right_corner = FALSE; }
			else center_bar_x -= 15;
		}
		else if (center_bar_x - DIFF >= X_BOUND + BAR_WIDTH/2 - 1) {
			draw_bar(center_bar_x, BLACK);
			center_bar_x -= (DIFF-2);
			in_left_corner = TRUE;
		}
	}
	
	while (RAVAIL > 0 && RVALID == 1) {
		// Clear the interrupt
		*(PS2_ptr) = 0xFF;
		PS2_data = *(PS2_ptr);
		RAVAIL = PS2_data & 0xFFFF0000;
		RVALID = PS2_data & 0x8000;
	}
	
	released = (released == 0) ? 1 : 0;
	return;
}

